import { Layout, Breadcrumb, Icon } from 'antd';
import React, { Component } from 'react';
import Home from './containers/shop/shop'
import { BrowserRouter, Route } from 'react-router-dom';
import MenuLayout from './components/layout/menu';
import HeadLayout from './components/layout/header';
const { Sider, Content } = Layout;
export default class SiderDemo extends Component {
  state = {
    collapsed: false,
    openKeys: ['sub1']
  };
  rootSubmenuKeys = ['sub1', 'sub2', 'sub4'];
  onOpenChange = (openKeys) => {
    const latestOpenKey = openKeys.find(key => this.state.openKeys.indexOf(key) === -1);
    if (this.rootSubmenuKeys.indexOf(latestOpenKey) === -1) {
      this.setState({ openKeys });
    } else {
      this.setState({
        openKeys: latestOpenKey ? [latestOpenKey] : [],
      });
    }
  }
  toggle = () => {
    this.setState({
      collapsed: !this.state.collapsed,
    });
  }
  render() {
    return (
      <BrowserRouter>
        <Layout>
          <Sider
            trigger={null}
            collapsible
            collapsed={this.state.collapsed}
            collapsedWidth={80}
          >
            <div style={{ width: 200, height: 60 }} />
            <MenuLayout />
          </Sider>
          <Layout>
            <HeadLayout toggle={this.toggle} collapsed={this.state.collapsed} />
            <Content style={{ margin: '10px', background: '#fff', minHeight: 300 }}>
              <Breadcrumb style={{ margin: '0' }}>
                <Breadcrumb.Item>Home</Breadcrumb.Item>
                <Breadcrumb.Item>List</Breadcrumb.Item>
                <Breadcrumb.Item>App</Breadcrumb.Item>
              </Breadcrumb>
              <Route path="/home" component={Home} />
            </Content>
          </Layout>
        </Layout>
      </BrowserRouter>
    );
  }
}
